import { IconContext } from 'react-icons';

export default function ConfigIcon({ children }) {
  return (
    <>
      <IconContext.Provider value={{ color: '#BEB9FF', size: '20%', align: 'left', padding: '0px' }}>
        {children}
      </IconContext.Provider>
    </>
  );
}
